import React, { useState, useEffect } from 'react';

const ProgramBenefitsSection: React.FC = () => {
  const [activeIndex, setActiveIndex] = useState(0);
  const [progress, setProgress] = useState(0);

  const benefits = [
    {
      title: "Learn From Experts (Live)",
      description: "No boring theory. You'll learn directly from experts who use AI daily to manage real projects, teams, and deadlines - even without coding",
      image: "https://images.unsplash.com/photo-1560472354-b33ff0c44a43?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1926&q=80"
    },
    {
      title: "Real-Time, Hands-On Practice",
      description: "Interactive exercises and real scenarios that you can immediately apply to your current projects and workflows",
      image: "https://images.unsplash.com/photo-1552664730-d307ca884978?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2069&q=80"
    },
    {
      title: "Boost Productivity By 10x",
      description: "Proven AI tools and techniques that will accelerate your project delivery and make you indispensable",
      image: "https://images.unsplash.com/photo-1531482615713-2afd69097998?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80"
    }
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setProgress((prev) => {
        if (prev >= 100) {
          setActiveIndex((current) => (current + 1) % benefits.length);
          return 0;
        }
        return prev + 1;
      });
    }, 50); // Update every 50ms for smooth animation

    return () => clearInterval(interval);
  }, [benefits.length]);
  return (
    <section className="bg-black py-4 relative">
      {/* Film Grain Noise Pattern */}
      <div 
        className="absolute inset-0 opacity-25 pointer-events-none"
        style={{
          backgroundImage: `url("data:image/svg+xml,%3Csvg viewBox='0 0 200 200' xmlns='http://www.w3.org/2000/svg'%3E%3Cfilter id='noiseFilter'%3E%3CfeTurbulence type='fractalNoise' baseFrequency='0.85' numOctaves='3' stitchTiles='stitch'/%3E%3CfeColorMatrix in='turbulence' type='saturate' values='0'/%3E%3C/filter%3E%3Crect width='100%25' height='100%25' filter='url(%23noiseFilter)' opacity='1'/%3E%3C/svg%3E")`,
          backgroundSize: '200px 200px'
        }}
      ></div>

      <div className="max-w-7xl mx-auto px-6 relative z-10">
        {/* Header */}
        <div className="text-center mb-12">
          <span className="bg-gray-800 text-gray-300 px-4 py-2 rounded-full text-sm font-medium border border-gray-600">
            Program Benefits
          </span>
          <h2 className="text-3xl lg:text-4xl font-bold text-white mt-6 mb-8">
            Why This Masterclass is a Game Changer?
          </h2>
        </div>

        {/* Main Content */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center mb-16">
          {/* Left Side - Benefits */}
          <div className="space-y-8">
            {/* Benefit 1 */}
            <div className="flex gap-4">
              <div className="w-1 bg-gradient-to-b from-orange-400 to-yellow-500 rounded-full flex-shrink-0"></div>
              <div>
                <h3 className="text-xl font-bold text-white mb-3">
                  Learn From Experts (Live)
                </h3>
                <p className="text-gray-400 leading-relaxed">
                  No boring theory. You'll learn directly from experts who use AI daily to manage real projects, teams, and deadlines - even without coding
                </p>
              </div>
            </div>

            {/* Benefit 2 */}
            <div className="flex gap-4">
              <div className="w-1 bg-gradient-to-b from-orange-400 to-yellow-500 rounded-full flex-shrink-0"></div>
              <div>
                <h3 className="text-xl font-bold text-white mb-3">
                  Real-Time, Hands-On Practice
                </h3>
                <p className="text-gray-400 leading-relaxed">
                  Interactive exercises and real scenarios that you can immediately apply to your current projects and workflows
                </p>
              </div>
            </div>

            {/* Benefit 3 */}
            <div className="flex gap-4">
              <div className="w-1 bg-gradient-to-b from-orange-400 to-yellow-500 rounded-full flex-shrink-0"></div>
              <div>
                <h3 className="text-xl font-bold text-white mb-3">
                  Boost Productivity By 10x
                </h3>
                <p className="text-gray-400 leading-relaxed">
                  Proven AI tools and techniques that will accelerate your project delivery and make you indispensable
                </p>
              </div>
            </div>
          </div>

          {/* Right Side - Image */}
          <div className="relative">
            <div className="rounded-2xl overflow-hidden">
              <div 
                className="h-80 lg:h-96"
                style={{
                  backgroundImage: `url("https://images.unsplash.com/photo-1560472354-b33ff0c44a43?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1926&q=80")`,
                  backgroundSize: 'cover',
                  backgroundPosition: 'center',
                  backgroundRepeat: 'no-repeat'
                }}
              ></div>
            </div>
          </div>
        </div>

        {/* Stats Section */}
        <div className="grid grid-cols-2 lg:grid-cols-4 gap-8 text-center">
          <div>
            <div className="text-4xl lg:text-5xl font-bold text-white mb-2">150k+</div>
            <div className="text-gray-400 text-sm">Active Users</div>
          </div>
          <div>
            <div className="text-4xl lg:text-5xl font-bold text-white mb-2">4.9</div>
            <div className="text-gray-400 text-sm">Rating out of 5</div>
          </div>
          <div>
            <div className="text-4xl lg:text-5xl font-bold text-white mb-2">99k+</div>
            <div className="text-gray-400 text-sm">Positive Reviews</div>
          </div>
          <div>
            <div className="text-4xl lg:text-5xl font-bold text-white mb-2">85k+</div>
            <div className="text-gray-400 text-sm">Users Satisfied</div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ProgramBenefitsSection;
